<!-- Map placeholder component for representing map content before loading -->
<!-- Used in location-based features, address displays, and map containers -->
<!-- RELEVANT FILES: ImagePlaceholder.svelte, VideoPlaceholder.svelte, LocationPinIcon.svelte, component.ts -->

<script lang="ts">
  import type { BaseProps, VariantComponent } from '../../types/component'

  interface Props extends BaseProps, VariantComponent<'default' | 'error' | 'loading'> {
    message?: string
  }

  let { variant = 'default', message, class: className = '' }: Props = $props()

  // Generate unique IDs for SVG elements to avoid conflicts
  const uniqueId = `map-${Math.random().toString(36).substr(2, 9)}`
  const clipPathId = `clip-${uniqueId}`
  const maskId = `mask-${uniqueId}`

  let containerClasses = $derived.by(() => {
    const base = 'absolute inset-0 flex items-center justify-center bg-surface overflow-hidden'
    return `${base} ${className}`
  })

  let mapPatternClasses = $derived.by(() => {
    const base = 'absolute inset-0 text-muted'
    const animation = variant === 'loading' ? 'animate-pulse' : ''
    return `${base} ${animation}`
  })

  let messageClasses = $derived.by(() => {
    return `absolute left-1/2 bottom-4 transform -translate-x-1/2 text-body-s text-center text-secondary bg-surface-elevated px-2 py-1 rounded`
  })
</script>

